export interface IVoiture{

    marque : string;
    modele : string;
    annee : number;
}

export class Voiture implements IVoiture{ 

    marque : string;
    modele : string;
    annee : number;

    constructor(marque : string, modele: string, annee : number){
        this.marque = marque;
        this.modele = modele;
        this.annee = annee;
    }
}
